import React from 'react';
import {useContext} from 'react';
import { Layout } from '../components/commons/Layout';
import {NewsletterContextProvider,NewsletterContext} from '../contexts/newsletterContext';
export const Stadistics = () => {
    const { getStadistics,stadisticsList} = useContext ( NewsletterContext );
    useEffect(() => {
        getStadistics();
      }, []);
      
   
  return (
    <div>
      <Layout>
      <NewsletterContextProvider>
      <div className="card col-8 offset-2">
          <div className="card-header">Stadistics </div>
          <div className="card-body">
         
     </div>
        </div> 
        </NewsletterContextProvider>
      </Layout>
    </div>
  )
}
